import React from "react";
import Card from "./Card";
import portfolioContent from "../content/portfolioContent";

function App() {
  return (
    <div class="app-div">
      {portfolioContent.map((portfolioItem) => {
        return (
          <div class="cards-section">
            <Card item={portfolioItem} />
          </div>
        );
      })}
    </div>
  );
}

export default App;
